Our bylaws designate a state or federal court located within the State of Delaware as the exclusive forum for certain litigation that may be initiated by our stockholders, which could limit stockholders’ ability to obtain a favorable judicial forum for disputes with us.
Our bylaws provide, to the fullest extent permitted by law, that a state or federal court located within the State of Delaware will be the exclusive forum for the following types of actions or proceedings under Delaware statutory or common law:
•any derivative action or proceeding brought on our behalf;
•any action asserting a breach of fiduciary duty;
•any action asserting a claim against us arising pursuant to the DGCL, our amended and restated certificate of incorporation, or our bylaws; or
•any action asserting a claim against us that is governed by the internal affairs doctrine. This exclusive forum provision will not apply to any causes of action arising under the Securities Act or the Exchange Act or any other claim for which the federal courts have exclusive jurisdiction. Nothing in our bylaws precludes stockholders that assert claims under the Securities Act or the Exchange Act from bringing such claims in state or federal court, subject to applicable law. This choice of forum provision may limit a stockholder’s ability to bring a claim in a judicial forum that it finds favorable for disputes with us or any of our directors, officers, or other employees, which may discourage lawsuits with respect to such claims. Alternatively, if a court were to find the choice of forum provision which will be contained in us bylaws to be inapplicable or unenforceable in an action, we may incur additional costs associated with resolving such action in other jurisdictions, which could harm our business, results of operations, and financial condition.

The audit committee’s duties, which are specified in the charter adopted by us and include, but are not limited to:
•meeting with our independent registered public accounting firm regarding, among other issues, audits, and adequacy of our accounting and control systems;
•monitoring the independence of the independent registered public accounting firm;
•verifying the rotation of the lead (or coordinating) audit partner having primary responsibility for the audit and the audit partner responsible for reviewing the audit as required by law;
•inquiring and discussing with management our compliance with applicable laws and regulations;
•pre-approving all audit services and permitted non-audit services to be performed by our independent registered public accounting firm, including the fees and terms of the services to be performed, and establishing pre-approval policies and procedures;
•appointing or replacing the independent registered public accounting firm;
•determining the compensation and oversight of the work of the independent registered public accounting firm (including resolution of disagreements between management and the independent auditor regarding financial reporting) for the purpose of preparing or issuing an audit report or related work;
•establishing procedures for the receipt, retention and treatment of complaints received by us regarding accounting, internal accounting controls or reports which raise material issues regarding our financial statements or accounting policies;
•monitoring compliance on a quarterly basis and, if any noncompliance is identified, immediately taking all action necessary to rectify such noncompliance or otherwise causing compliance; •obtaining and reviewing a report, at least annually, from the independent registered public accounting firm describing (i) the independent registered public accounting firm’s internal quality-control procedures, (ii) any material issues raised by the most recent internal quality-control review, or peer review, of the audit firm, or by any inquiry or investigation by governmental or professional authorities within the preceding five years respecting one or more independent audits carried out by the firm and any steps taken to deal with such issues and (iii) all relationships between the independent registered public accounting firm and us to assess the independent registered public accounting firm’s independence;

•reviewing and approving the compensation of all of our other Section 16 executive officers;
•reviewing our executive compensation policies and plans;
•implementing and administering our incentive compensation equity-based remuneration plans;
•assisting management in complying with our proxy statement and annual report disclosure requirements;
•approving all special perquisites, special cash payments and other special compensation and benefit arrangements for our executive officers and employees;
•producing a report on executive compensation to be included in our annual proxy statement; and
•reviewing, evaluating and recommending changes, if appropriate, to the remuneration for directors. The charter also provides that the compensation committee may, in its sole discretion, retain or obtain the advice of a compensation consultant, legal counsel or other adviser and will be directly responsible for the appointment, compensation and oversight of the work of any such adviser. However, before engaging or receiving advice from a compensation consultant, external legal counsel or any other adviser, the compensation committee will consider the independence of each such adviser, including the factors required by Nasdaq and the SEC.
